import "joke.css";
import React from "react";
import { JokeI } from "../home";
import ActionJoke from "./actionJoke";
export interface JokeProps {
	joke: JokeI | null;
	onPressJoke: (isFunny: boolean) => void;
}

const Joke: React.FC<JokeProps> = ({ joke, onPressJoke }) => {
	return (
		<div
			style={{
				flex: 1,
				backgroundColor: "#FFF",
				paddingLeft: "22%",
				paddingRight: "22%",
				paddingTop: 60,
				paddingBottom: 30,
			}}
		>
			<span style={{ fontSize: 15, fontWeight: "400", color: "#646464" }}>{joke ? joke.content : ""}</span>
			<ActionJoke onPressJoke={onPressJoke} />
		</div>
	);
};

export default Joke;
